@PalmerReport Obviously, our enemies (russia and China) have kept trying to introduce misinformation to American voters. 

Are they also messing with polling? 

Seems like a good way to make people question elections.

@SquawkCNBC Yeah, that would be good for the world. But is it possible? 

It's up to the US to choose. 

[China is unlikely to become like Japan.]

@supersayan68200 Too much socialist history for that to happen. 

Also because neoliberal globalisation peaked in 2010, and world is moving toward a different type of free trade model, it's even more unlikely. 

Protectionism in key sectors. Diversification of global supply chains bcoz of China.
